if mibBuilder.loadTexts: vismCodecPreference.setDescription('This object contains the user configured preference for each codec. Lower the number, higher the preference of the codec. If the call agent does not specify the preferred codec list in CRCX(CreateConnection) request then the codec used will be the one of highest preference, as configured in this object. The default preference based on the codec type is G729ab will have preference 1 G729a will have preference 2 G726 at rate 16 kbps will have preference 3 G726 at rate 24 kbps will have preference 4 G726 at rate 32 kbps will have preference 5 G726 at rate 40 kbps will have preference 6 G.711u will have preference 7 for T1 and will have preference 8 for E1 G.711a will have preference 7 for E1 card and will have preference 8 for T1 clearChannel will have preference 9 G723H will have preference 10 G723AH will have preference 11 G723L will have preference 12 G723AL will have preference 13 Lossless will have preference 14 If the preference of a codec is zero then that codec will not be used. ')
