if mibBuilder.loadTexts: vismCodecString.setDescription('The local connection option or SDP(Session Description Protocol) descriptor string that VISM would get from the call agent for the codec to be used will be in the form of PCMU, PCMA, G726 at rate 32 kbps, G729a, CCD ..... where in PCMU stands for G711u PCMA stands for G711a and CCD stands for clear channel This object serves as a mapping string, and VISM will use the value configured in this object to match the SDP descriptor string obtained for a codec in a CRCX or MDCX(ModifyConnection) message. Since the entries in this table are implicitly created by default the entry with codec = G.711u will have a value of PCMU G.711a will have a value of PCMA clear channel will have a value of CCD G.726 at rate 32 kbps will have G726 at rate 32 kbps G.726 at rate 16 kbps will have G726 at rate 16 kbps G.726 at rate 24 kbps will have G726 at rate 24 kbps G.726 at rate 40 kbps will have G726 at rate 40 kbps G.729a will have G729a G.729ab will have G729ab G.723.1-H will have G723H G.723.1a-H will have G723AH G.723.1-L will have G723L G.723.1a-L will have G723AL Lossless will have Lossless ')
